import React, { Component } from 'react';
import './mainVoteContent.css';

class Subject extends Component {
  render(){
    return (
      <header>
        <div class="JM_VOTE_CONTENT">
          <div class="content_1">
            <div class="cont1_img"></div>
            <div class="cont1_text">또 가고 싶은 맛집은?</div>
          </div>
        </div>
      </header>
    );
  }
}

export default Subject;
